<template>
    <div>
        <h1>오늘의 기분은 !? {{ msg }}</h1>
        <img :src="imgSrc" :alt="msg" />
    </div>
</template>

<script setup>
import { ref, computed, watch } from "vue";
import { useRoute } from "vue-router";

const currentRoute = useRoute();
const mood = ref(currentRoute.params.mood);

watch(
    () => currentRoute.params.mood,
    (newMood) => (mood.value = newMood)
);

const msg = computed(() =>
    mood.value === "happy" ? "행복합니다" : "씐납니다!"
);

const imgSrc = computed(() =>
    mood.value === "happy"
        ? "data:image/jpeg;base64,"
        : "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT3uwtR7xsn5lTfcG5kcsYjwybNxG857ld3yA&s"
);
</script>
